import React from 'react';
import SearchBar from './SearchBar';

class App extends React.Component {
	state = {
		images: [],
	};
	onSearchSubmit = () => {};
	render() {
		return <SearchBar onSubmit={this.onSearchSubmit} />;
	}
}

export default App;
